import React from 'react';

import Footer from '../UI/Footer';
import NavBar from '../UI/NavBar';

const Cart = () => {
  return (
    <div>
      <NavBar />
      <h1>Cart Page</h1>
      <Footer />
    </div>
  );
};

export default Cart;
